CREATE TABLE `leave_logs` (
  `userid` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `datein` date NOT NULL,
  `time` time NOT NULL,
  `event` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `remark` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `edited` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `holiday` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `desc` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`userid`,`datein`,`time`,`event`),
  KEY `leave_logs_userid_index` (`userid`),
  KEY `leave_logs_datein_index` (`datein`),
  KEY `leave_logs_time_index` (`time`),
  KEY `leave_logs_event_index` (`event`),
  KEY `leave_logs_holiday_index` (`holiday`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
