INSERT INTO `office_order` VALUES (23,'2018-4030302114755','OFFICE_ORDER','','Authority for the following DOH RO7 Personnel to proceed to Civil Service Commission RO VII, Sudlon, Lahug, Cebu City on 19th of March 2018','The following DOH personnel are hereby authorized to attend the <b>Gender Sensitivity Training</b> in Civil Service Commission RO VII, Sudlon, Lahug, Cebu City on 19th of March 2018:','<p>Registration Fee of Php 2,800.00 (1,400.00 per participant) shall be chargeable against 2018 STO-Operations of Regional Offices  MSD Fund subject to the usual accounting and auditing rules and regulations.</p><p>Further, they are entitled to use office vehicle subject to its availability.<br></p>','SOPHIA MANCAO MD, DPSP','0443','03/02/2018','2','1',NULL,NULL,'2018-03-02 03:47:55','2018-03-02 05:07:09'),(24,'2018-2390305105310','OFFICE_ORDER','','Authority for the following personnel to proceed to Social Hall of the Department of Education, Cebu City on 7 March 2018, Wednesday.','The following personnel are hereby authorized to attend and present the Cebu City 2019 Budget Proposal on 7 March 2018 (9:00 AM- 12:00 PM), Wednesday at Social Hall of the Department of Education, Cebu City Division, New Imus St., Day-as, Cebu City.','<p>Furthermore, they are entitled to use office vehicle subject to its availability.<br></p>','SOPHIA MANCAO MD, DPSP','0031','03/05/2018','2','1',NULL,NULL,'2018-03-05 02:53:10','2018-03-05 03:41:25'),(26,'2018-2390307171529','OFFICE_ORDER','','Authority for the following personnel to proceed to NEDA Conference Room, Cebu City on 9 March 2018, Friday.','<p>The following personnel are hereby authorized to attend the Consultation Meeting on the LGUs List of PAP\'s for National Government Agency Funding on 9 March 2018, Friday at NEDA Conference Room, Sudlon, Lahug, Cebu City.</p>','Furthermore, they are entitled to use office vehicle subject to its availability.','SOPHIA MANCAO MD, DPSP','0031','03/07/2018','2','1',NULL,NULL,'2018-03-07 09:15:29','2018-03-07 09:23:23'),(27,'2018-4430309105048','OFFICE_ORDER','','Authority for the following personnel to proceed to Social Hall of the Department of Education, Cebu City on 7 March 2018, Wednesday.','The following personnel are hereby authorized to attend and present the Cebu City 2019 Budget Proposal on 7 March 2018(9:00 AM - 12:00 PM), Wednesday at Social of the Department of Education, Cebu City Division, New Imus St., Days, Cebu City.','Registraion Fee of Php 2,800.00 (1,400.00 per participant) shall be chargeable against 2018 STO-Operation of Regional Offices - MSD Fund subject to the usual accounting and auditing rules and regulation.<br>Further, they are entitled to use office vehicles subject to its availability.','Jaime S. Bernadas, MD, MGM, CESO III','0546','2018-03-09 10:50:48','2','0',NULL,NULL,'2018-03-09 02:50:48','2018-03-09 02:50:48'),(28,'2018-2390310164923','OFFICE_ORDER','','Authority for the following personnel to proceed to City State Tower Hotel, Manila on March 15-16, 2018.','<p>The following personnel are hereby authorized to attend the Strategic Planning and Risk Based Thinking for ISO 9001:2015 on 15-16 March 2018 at City States Tower Hotel, Manila.</p>','<p>Ms. Anwar&nbsp; is entitled to claim transportation expenses and per diem day before and after&nbsp;while Ms. Pielago can claim actual travelling expenses and both are entitled for the registration fee of Php 7,800.00 per participant chargeable against 2018 STO- Operations of Regional Offices- MSD Fund subject to the usual accounting and auditing rules and regulations.</p>','Jaime S. Bernadas, MD, MGM, CESO III','0031','03/09/2018','2','1',NULL,NULL,'2018-03-10 08:49:23','2018-03-13 05:31:51'),(29,'2018-2390313133609','OFFICE_ORDER','','Authority for the following personnel to proceed to Montebello Villa Hotel, Cebu City.','<p>The following personnel are hereby authorized to attend the Joint RDC Full Council and Advisory Committee Meeting on 16 March 2018 (10:00 AM- 2:00 PM), Friday at Montebello Villa Hotel, Cebu City.<br><br><br></p>','Furthermore, they are entitled to use office vehicle subject to its availability.','Sophia M. Mancao, MD, DPSP','0031','2018-03-13 13:36:09','2','0',NULL,NULL,'2018-03-13 05:36:09','2018-03-13 05:36:09'),(31,'2018-2390320153452','OFFICE_ORDER','','Authority for the following personnel to proceed to NEDA 7 (22 March 2018, Thursday) and St. Mark Hotel, Cebu City (23 March 2018, Friday).','The following personnel are hereby authorized to attend the RDC Social Development Committee (RDC) Meeting on 22 March 2018, 1:00 PM, Thursday at NEDA 7 Conference Room, Sudlon, Lahug, Cebu City and CV-RSDP 2018-2023 Sectoral Consultative Workshop and RSC Special Meeting on 23 March 2018, 9:00 AM, Friday at St.Mark Hotel, Cebu City.','Furthermore, they are entitled to use office vehicle subject to its availability.','Sophia M. Mancao, MD, DPSP','0031','03/20/2018','2','0',NULL,NULL,'2018-03-20 07:34:52','2018-03-20 07:56:32'),(32,'2018-2690402100741','OFFICE_ORDER','','Data Validation','','','','0056','2018-04-02 10:07:41','1','0',NULL,NULL,'2018-04-02 02:07:41','2018-04-02 02:07:41'),(33,'2018-4280402134853','OFFICE_ORDER','','Authority of some DOH-RO7 personnel to proceed to various municipalities in Cebu.','<p>The following DOH RO 7 personnel are hereby authorized to proceed to Isidro Kintanar Memorial Hospital, Argao, Cebu on April 3 to 4, 2018 and Dr. Jose Ma. Borromeo Memorial Hospital, Pinamungajan, Cebu on April 5 to 6, 2018&nbsp; to conduct monitoring and technical assistance&nbsp; of HOMIS Billing System (HBSys).</p>','<p>They shall be entitled to claim actual Traveling expenses chargeable against SAA 2018-02-0059 subject to the usual accounting and auditing rules regulation.</p>','Sophia M. Mancao, MD, DPSP','0413','04/02/2018','2','1',NULL,NULL,'2018-04-02 05:48:53','2018-04-02 05:53:53'),(34,'2018-6180402140106','OFFICE_ORDER','','Authority for Ms. Jessa Joy C. Laniba, Computer Programmer 1 (J.O) to proceed to Du