o 19, 2018 to conduct HOMIS Billing System (HBSys) technical support and eClaims submission training.','They shall be entitled to claim actual travelling expenses chargeable against SAA 2018-02-0059 Funds subject to the usual accounting and auditing rules and regulations.','Sophia M. Mancao, MD, DPSP','0558','2018-07-12 10:37:58','2','0','',NULL,'2018-07-12 02:37:58','2018-07-12 02:37:58'),(92,'2018-4360712123017','OFFICE_ORDER','','Authority for some office personnel to proceed to Iloilo City on July 30 to August 3, 2018.','.<div>The following personnel are hereby authorized to proceed to Iloilo City to attend the 2018 Health Information and Communications Technology (HICT) and 9th Web Users\' Conference on July 30 to August 3, 2018.</div>','<p>Mr. Epistola is entitled to claim travelling expenses, per diem including the day before and after the said activity and other incidental expenses&nbsp; chargeable against 2018 STO-Operations of Regional Offices Funds, while Mr. Traya is entitled to claim actual travelling expenses and other incidental expenses chargeable against 2018 STO-Operations of Regional Offices Funds subject to the usual accounting and auditing rules and regulations.</p>','Jaime S. Bernadas, MD, MGM, CESO III','0526','07/12/2018','2','1','',NULL,'2018-07-12 04:30:17','2018-07-12 04:56:29'),(93,'2018-4360720094032','OFFICE_ORDER','','Authority of Mr. Gorosin to proceed to Negros Oriental on July 25-27, 2018. (Live-out)','<p>Mr. Gorosin is hereby authorized to proceed to the Provincial Department of Health-Negros Oriental to conduct Preventive Maintenance on July 25-27, 2018 at Negros Oriental.</p>','<p>Mr. Gorosin is entitled to claim actual travelling expenses chargeable against 2018 STO-Operations of Regional Offices Funds subject to the usual accounting and auditing rules and regulations.<br></p>\r\n\r\n\r\n\r\n\r\n\r\n<br><p></p>','Sophia M. Mancao, MD, DPSP','0526','07/20/2018','2','0','',NULL,'2018-07-20 01:40:32','2019-01-25 01:02:27'),(94,'201