CREATE DEFINER=`root`@`localhost` PROCEDURE `calendar`(IN userid int)
BEGIN
	SELECT T.* from(
		SELECT
		cl.id,
		cl.event_id,
		cl.title,
		cl.start as start,
		cl.end,
		cl.backgroundColor,
		cl.borderColor,
		cl.status
		FROM dohdtr.calendar cl WHERE cl.status = 1
		
