		FROM dohdtr.cdo c
		LEFT JOIN pis.personal_information pi on pi.userid = c.prepared_name
		where c.prepared_name = any(
			SELECT pi_any.userid FROM pis.personal_information pi_any
			WHERE pi_any.section_id = 
			any(SELECT pi2_any.section_id from pis.personal_information pi2_any where pi2_any.userid = userid)
		)
			
		UNION
		SELECT 
		"no_calendar_id",
		"no_event_id",
		concat(so.subject,'\r\n',concat( pi.fname,' ',pi.lname,' ',SUBSTRING(pi.mname, 1, 1),'.'),'\r\n',concat('(OFFICE ORDER)')),
		cl.start as start,
		cl.end,
		"rgb(96, 92, 168)",
		"rgb(96, 92, 168)",
		"0"
		FROM dohdtr.inclusive_name inc
		LEFT JOIN pis.personal_information pi on pi.userid = inc.userid
		LEFT JOIN dohdtr.office_order so on inc.route_no = so.route_no
		LEFT JOIN calendar cl on inc.route_no = cl.route_no
		where inc.userid = any(
			SELECT pi_any.userid FROM pis.personal_information pi_any
			WHERE pi_any.section_id = 
			any(SELECT pi2_any.section_id from pis.personal_information pi2_any where pi2_any.userid = userid)
		)
    ) AS t
    order by t.start desc;
END ;;
