    READS SQL DATA
    DETERMINISTIC
BEGIN



		SELECT DISTINCT e.userid, datein,holiday,remark,time_type,

			(SELECT  CONCAT(t1.time,'_',t1.edited) FROM cdo_logs t1 WHERE userid = d.userid and datein = d.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) as am_in,

			(SELECT  CONCAT(t2.time,'_',t2.edited) FROM cdo_logs t2 WHERE userid = d.userid and datein = d.datein and (SELECT  CONCAT(t1.time,'_',t1.edited) FROM cdo_logs t1 WHERE userid = d.userid and datein = d.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) and  t2.time < PMIN AND t2.event = 'OUT' AND t2.time > AMIN ORDER BY t2.time DESC LIMIT 1 ) as am_out,

			(SELECT  CONCAT(t3.time,'_',t3.edited) FROM cdo_logs t3 WHERE userid = d.userid AND datein = d.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1) as pm_in,

			(SELECT  CONCAT(t4.time,'_',t4.edited) FROM cdo_logs t4 WHERE userid = d.userid AND datein = d.datein and t4.time >= PMIN AND t4.event = 'OUT' ORDER BY time DESC LIMIT 1) as pm_out


