CREATE DEFINER=`root`@`localhost` PROCEDURE `test`(IN AMIN VARCHAR(10), IN AMOUT VARCHAR(10), IN PMIN VARCHAR(10), IN PMOUT VARCHAR(10), IN ID VARCHAR(10), IN DATE_FROM VARCHAR(10), IN DATE_TO VARCHAR(10))
BEGIN

SELECT tayong.* FROM(
	(SELECT DISTINCT
		e.userid, 
		datein,
		holiday,
		remark, 
		COALESCE(
			(SELECT  CONCAT(t1.time,'_',t1.edited) FROM dtr_file t1 WHERE userid = d.userid and datein = d.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1)
			,
			(SELECT DISTINCT
				(SELECT  CONCAT(t1.time,'_',t1.edited) FROM edited_logs t1 WHERE userid = d.userid and datein = d.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1)
				FROM edited_logs editedLogs_amin LEFT JOIN users e
				ON editedLogs_amin.userid = e.userid and datein = editedLogs_amin.datein

				WHERE editedLogs_amin.datein = d.datein
				AND e.userid = ID
				group by editedLogs_amin.datein
				ORDER BY datein ASC)
		) as am_in,
		COALESCE(
			(SELECT  
				CONCAT(t2.time,'_',t2.edited) FROM dtr_file t2 WHERE userid = d.userid and datein = d.datein and (SELECT  CONCAT(t1.time,'_',t1.edited) FROM dtr_file t1 WHERE userid = d.userid and datein = d.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) and  t2.time < PMIN AND t2.event = 'OUT' AND t2.time > AMIN ORDER BY t2.time DESC LIMIT 1 )
			,
			(SELECT DISTINCT
				(SELECT  CONCAT(t2.time,'_',t2.edited) FROM edited_logs t2 WHERE userid = editedLogs_amout.userid and datein = editedLogs_amout.datein and (SELECT  CONCAT(t1.time,'_',t1.edited) FROM edited_logs t1 WHERE userid = editedLogs_amout.userid and datein = editedLogs_amout.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) and  t2.time < PMIN AND t2.event = 'OUT' AND t2.time > AMIN ORDER BY t2.time DESC LIMIT 1 )
				FROM edited_logs editedLogs_amout LEFT JOIN users e
						ON editedLogs_amout.userid = e.userid and datein = editedLogs_amout.datein

				WHERE editedLogs_amout.datein = d.datein
							AND e.userid = ID
				group by editedLogs_amout.datein
				ORDER BY datein ASC)
		) as am_out,
		
		COALESCE(
			(SELECT  
				CONCAT(t3.time,'_',t3.edited) FROM dtr_file t3 WHERE userid = d.userid AND datein = d.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1)
			,
			(SELECT DISTINCT
				(SELECT  
					CONCAT(t3.time,'_',t3.edited) 
					FROM edited_logs t3 WHERE userid = editedLogs_pmin.userid AND datein = editedLogs_pmin.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1
				)
					
				FROM edited_logs editedLogs_pmin LEFT JOIN users e
						ON editedLogs_pmin.userid = e.userid and datein = editedLogs_pmin.datein
				WHERE editedLogs_pmin.datein = d.datein
							AND e.userid = ID
				group by editedLogs_pmin.datein
				ORDER BY datein ASC)
		) as pm_in,
		
		COALESCE(
			(SELECT  
				CONCAT(t4.time,'_',t4.edited) FROM dtr_file t4 
				WHERE userid = d.userid 
				AND datein = d.datein 
				and t4.time > PMIN 
				AND t4.event = 'OUT' 
				AND t4.time > 
				IF(
				  (SELECT  CONCAT(t3.time,'_',t3.edited) FROM dtr_file t3 WHERE userid = d.userid AND datein = d.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1),
				  (SELECT  CONCAT(t3.time,'_',t3.edited) FROM dtr_file t3 WHERE userid = d.userid AND datein = d.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1),
				  (0)
				  )ORDER BY time DESC LIMIT 1
			),
			(SELECT DISTINCT
				(SELECT  CONCAT(t4.time,'_',t4.edited) FROM edited_logs t4 WHERE userid = editedLogs_pmout.userid AND datein = editedLogs_pmout.datein and t4.time >= PMIN AND t4.event = 'OUT' ORDER BY time DESC LIMIT 1)
				FROM edited_logs editedLogs_pmout LEFT JOIN users e
					ON editedLogs_pmout.userid = e.userid and datein = editedLogs_pmout.datein

				WHERE editedLogs_pmout.datein = d.datein
				AND e.userid = ID
				group by editedLogs_pmout.datein
				ORDER BY datein ASC)
		) as pm_out
		
		FROM dtr_file d LEFT JOIN users e
		ON d.userid = e.userid and datein = d.datein 

		or (datein between DATE_FROM AND DATE_TO and holiday = '002' and d.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '003' and d.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '004' and d.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '005' and d.userid = e.userid)
		WHERE d.datein BETWEEN DATE_FROM AND DATE_TO
		AND e.userid = ID)
        
        UNION
        
        (SELECT DISTINCT e.userid, datein,holiday,remark,

			(SELECT  CONCAT(t1.time,'_',t1.edited) FROM edited_logs t1 WHERE userid = wowo.userid and datein = wowo.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) as am_in,

			(SELECT  CONCAT(t2.time,'_',t2.edited) FROM edited_logs t2 WHERE userid = wowo.userid and datein = wowo.datein and (SELECT  CONCAT(t1.time,'_',t1.edited) FROM edited_logs t1 WHERE userid = wowo.userid and datein = wowo.datein and t1.time < AMOUT AND t1.event = 'IN' ORDER BY time ASC  LIMIT 1) and  t2.time < PMIN AND t2.event = 'OUT' AND t2.time > AMIN ORDER BY t2.time DESC LIMIT 1 ) as am_out,

			(SELECT  CONCAT(t3.time,'_',t3.edited) FROM edited_logs t3 WHERE userid = wowo.userid AND datein = wowo.datein and t3.time > AMOUT and t3.time < PMOUT AND t3.event = 'IN' ORDER BY t3.time ASC LIMIT 1) as pm_in,

			(SELECT  CONCAT(t4.time,'_',t4.edited) FROM edited_logs t4 WHERE userid = wowo.userid AND datein = wowo.datein and t4.time >= PMIN AND t4.event = 'OUT' ORDER BY time DESC LIMIT 1) as pm_out


		FROM edited_logs wowo LEFT JOIN users e
		ON wowo.userid = e.userid and datein = wowo.datein 

		or (datein between DATE_FROM AND DATE_TO and holiday = '002' and wowo.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '003' and wowo.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '004' and wowo.userid = e.userid)
		or (datein between DATE_FROM AND DATE_TO and holiday = '005' and wowo.userid = e.userid)
		WHERE wowo.datein BETWEEN DATE_FROM AND DATE_TO
		AND e.userid = ID)
) 
AS tayong 
group by tayong.datein
ORDER BY tayong.datein ASC;
END ;;
